NOTA1:
Este grupo se aplica a las personas analfabetas. Se considera analfabetas a las personas de 16 y más años que teniendo en cuenta cualquier lengua del mundo cumplen:

- 	no son capaces de leer ni de escribir;
- 	son capaces de leer pero no de escribir;
- 	son capaces de leer y escribir sólo una o varias frases que recuerdan de memoria;
- 	son capaces de leer y escribir sólo números o su propio nombre.

En este grupo se clasifican:

-	Analfabetos
